const image_model = require('../../../models/image')
const mongoose = require('mongoose')

const get_image = async (req, res) => {
    try {
        if (!mongoose.isValidObjectId(req.params.id)) {
            throw { error_msg: "INVALID LINK" }
        }
        const image = await image_model.findById(req.params.id, ['mimetype', 'data', '-_id'])
        if (!image) {
            // throw { error_msg: "gone" }
            const data = `data:image/png;base64,`
            return res.send(data)
        }
        const data = `data:${image.mimetype};base64,${image.data}`
        return res.send(data)
        // res.send(image)
    } catch (e) {
        console.log(e)
        if (e.error_msg) return res.sendStatus(404)
        return res.status(500).send({ error_msg: "server error" })
    }

}

module.exports = get_image